import 'package:whatsappsendnumber/core/db/features/country_data_base/data_base/country_daba_base_impl.dart';import 'package:whatsappsendnumber/features/start_chat/data/data_source/country_data_source.dart';import 'package:whatsappsendnumber/features/start_chat/domain/models/country_model.dart';import 'package:whatsappsendnumber/features/start_chat/framework/data/implementation/data_source/mapper/map_country_dto_to_country_model.dart';class CountryDataSourceImpl extends CountryDataSource {  final CountryDataBaseImpl countryDataBaseImpl;  final MapCountryDtoToCountryModel _mapCountryDtoToCountryModel;  CountryDataSourceImpl(this.countryDataBaseImpl, this._mapCountryDtoToCountryModel);  @override  Future<CountryModel> getCountryCurrent() async {    final country = await countryDataBaseImpl.getCountryCurrent();    return _mapCountryDtoToCountryModel.map(country);  }}